import React, { Component } from 'react';
import { Box, Button } from 'grommet';

class Header extends Component {
	render() {
		return (
			<Box
				direction="row"
				gap="medium"
                pad={{ vertical: 'medium', left: 'medium' }}
                background="brand"
                elevation="small"
			>
				<Button>Generate New Array</Button>
                <Box>
                    <p>Array size</p>
                    
                </Box>
			</Box>
		);
	}
}

export default Header;
